import React, { Component } from 'react';
class ItemCart extends Component {
    render() {
        return (
            <tr>
                <th>STT</th>
                <th>TÊN</th>
                <th>SỐ LƯỢNG</th>
                <th>ĐƠN GIÁ(VNĐ)</th>
                <th>TỔNG</th>
                <th>XÓA</th>
            </tr>
        )
    }
}
export default ItemCart;
